然后，执行命令安装依赖：（还在 ios 目录下，哦~）
pod install
这个下载过程异常缓慢。。。。。。。
6. 编写 React Native 内容
1.在 testiOSRN 文件夹下，创建一个名为：index.js 的文件。
可以通过 touch 命令创建：
